import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom'; // Import BrowserRouter
import App from './App';
import './index.css';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <App /> {/* Wrap App with BrowserRouter */}
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
